import React from "react";
import portfolio, {
  name,
  description,
  ghlink,
  deployed,
  image,
} from "../../portfolio.json";

function Card({ name, description, ghlink, deployed, image }) {
  return (
    <div className="s12 col m4">
      <div className="card-image">
        <img src={image} />
      </div>
      <div className="card-content">
        <p>
          <b>{name}</b>
          {description}
        </p>
        <br />
        <i>
          <a href={ghlink}>Github</a>
        </i>
        <i>
          <a href={deployed}>Deployed site</a>
        </i>
      </div>
    </div>
  );
}

export default Card;
